'''BF: Fails for large i/p's & K on LC [Time Limit Exceeded]; 
The time complexity of the given code is O(n * k), and the space complexity is O(1)'''
class Solution:
    def findMaxAverage(self, nums: list[int], k: int) -> float:
        # My Brute force logic
        max_sum = -float('inf') # = 0 will always set max_sum = 0 if cur_sum < 0 ~ -ve.

        for i in range(len(nums) - k + 1):
            cur_sum = 0
            j = i 
            while (j < i + k):
                cur_sum += nums[j]
                j += 1
            max_sum = max(max_sum, cur_sum)
        return max_sum/k # Avg

